pub struct ResearchWorkflow { client: MitoClient, group: String,
} impl ResearchWorkflow { pub async fn run_parameter_sweep(&mut self, parameters: Vec<Vec<String>>) -> Result<Vec<Uuid>, Box<dyn std::error::Error>> { let mut task_ids = Vec::new(); for (i, params) in parameters.into_iter().enumerate() { let args = TaskSubmitArgs { command: vec!["python3".to_string(), "experiment.py".to_string()], env: params.into_iter().map(|p| format!("PARAM_{}", p)).collect(), group: Some(self.group.clone()), labels: vec![format!("sweep:experiment-{}", i)], tags: vec!["gpu".to_string(), "python".to_string()], terminal: true, ..Default::default() }; let task_id = self.client.task_submit(args).await?; task_ids.push(task_id); } Ok(task_ids) } pub async fn collect_results(&mut self, task_ids: Vec<Uuid>) -> Result<(), Box<dyn std::error::Error>> { for task_id in task_ids { let args = TaskArtifactDownloadArgs { task_id, artifact_type: "result".to_string(), output_path: Some(format!("results/{}.tar.gz", task_id)), ..Default::default() }; self.client.task_artifact_download(args).await?; } Ok(()) }
}

